import './App.css';
import React from "react"


function App(props) {
  console.log(props)
  return (
    <div className="contact">
      <div className="contact-card">
        <img src={props.imgurl}/>
        <h1>{props.name}</h1>
        </div>
    </div>
  );
}

export default App;
